  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded bathymetry and IKONOS estimated
  depths of the shelf and slope environments of the Northwestern Hawaiian Islands,
  USA within UTM Zone 3. Bottom coverage was achieved in depths between 0 and 5200
  meters. The netCDF includes multibeam bathymetry from the Simrad EM300, Simrad EM3002d,
  and Reson 8101 multibeam sonars collected as of May 2009 by the NOAA Coral Reef
  Ecosystem Division in depths between 20 and 5200 meters. The netCDF grid also includes
  multibeam bathymetry from the SeaBeam 3012 phase 1 hybrid multibeam sonar system
  installed on the R/V Kaimikai-o-Kanaloa provided by the Hawaii Undersea Research
  Laboaratory for this data synthesis. The netCDF grid also includes estimated depths
  derived from high resolution IKONOS satellite imagery by the NOAA/NOS/NCCOS/CCMA
  Remote Sensing Team in shallow water between 0 and 16 meters.\",\n\t\"license_title\":
